import React from "react";
import "./ContentList.css";

function ContentList({ datas }) {
  return (
    <div className="ContentList">
      <header>
        <div></div>
        <h2>목록</h2>
        <button>글쓰기</button>
      </header>
      <div className="data">
        <div className="data__name">강혜원</div>
        <div className="data__number">0</div>
        <div className="data__title">테스트 제목</div>
        <div className="data__date">2022.06.18</div>
      </div>

      {datas.map((data) => (
        <div>{data.content}</div>
      ))}
    </div>
  );
}

export default ContentList;
